import logo from './logo.svg';
import './App.css';
import Home from "./pages/Home";
import {Route, Router, Routes} from "react-router-dom";

function App() {
  return (
      <Router>
          <Routes>
            <Route path="/home" element={<Home/>}/>
          </Routes>
      </Router>

  );
}

export default App;
